import Game from "../Game/index.js"

import { FlexContainer } from "./styles.js"

const GamesContainer = ({ games }) => {
    return (
        <FlexContainer>
            {games.map((item, index) => (
                <Game key={index} name={item} />
            ))}
        </FlexContainer>
    )
}

export default GamesContainer
